from typing import Callable, Any, Awaitablefrom aiogram import typesfrom aiogram import BaseMiddlewarefrom aiogram.types import Updateclass AdminOnlyMiddleware(BaseMiddleware):    def __init__(self, admin_ids: list[int]):        self.admin_ids = admin_ids        self.sticker_id = 'CAACAgIAAxkBAAEMvM1m0f5CZNWRv76x3kj42Mk008NpuQACARkAAtHlOEi93Ol6wCzV1zUE'        super().__init__()    async def __call__(self, handler: Callable[[Update, dict[str, Any]], Awaitable[Any]],                       event: Update, data: dict[str, Any]) -> Any:        user_id = None        chat_id = None        if event.message:            user_id = event.message.from_user.id            chat_id = event.message.chat.id        elif event.callback_query:            user_id = event.callback_query.from_user.id        if user_id not in self.admin_ids:            bot = data['bot']            await bot.send_message(chat_id, 'В тебе немає прав для отримання інформації')            await bot.send_sticker(chat_id, self.sticker_id)            return None        return await handler(event, data)